import "../Styles/nav.css";

function Navbar() {
  return (
    <div className="navHolder">
      <div className="navHolder__logoHolder">
        <img src="https://via.placeholder.com/60"
          alt="icon" />
        <div className="navHolder__logoTitle">Shareable WhiteBoard</div>
      </div>
    </div>
  );
}

export default Navbar;
